import React from 'react'
import Game from './game'
import Player from './player'


class Page extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
          items: []
        };
      }
    
    render() {
        return (
            <div className="container">
                
                <Player value={this.props.match.params.id} />
                <div className="move">
                    <div className="row">
                        <Game />
                    </div>
                </div>
            </div>
        )
    }
}

export default Page
